'use strict';

var state = {
  last: 0
};

function Tabs(elementId) {
  var tabs = document.querySelectorAll(elementId + ' .EmpyTabs-flexContainer .EmpyTab');
  var Panels = document.querySelectorAll(elementId + ' .EmpyPanels-flexContainer .EmpyPanel');

  tabs.forEach(function (item, index) {
    item.addEventListener('click', function () {
      Panels[state.last].style.display = 'none';
      Panels[index].style.display = 'block';
      state.last = index;
      if (item.classList.contains('active')) {
        return;
      }
      tabs.forEach(function (item) {
        item.classList.remove('active');
      });
      item.classList.add('active');
    });
  });
}
